import React from 'react';
import {connect} from "react-redux";
import {actionPlace} from "../ducks/boardReducer";
import {changePlayer} from "../ducks/currentPlayerReducer";
import {handleSquareClicked} from "../thunks/handleSquareClicked";

const BoardSquare = ({handleSquareClicked, index, square}) => {

    return (
        <buton
            className='square'
            onClick={() => handleSquareClicked(index)}
            // disabled={props.gameWon}
        >
            {square}
        </buton>
    );
};

export default connect(null, { handleSquareClicked })(BoardSquare);
